@publisherswkly: “Vivid characterizations and a strain of black humor add to the pointed drama . . . Brutal, graphic, and gory, the battle scenes viscerally hurl the reader into the heat of 14th-century combat.” (Starred review)

@library_journal: “Highly recommended for fans of Bernard Cornwell or Ken Follett who are looking for a high-stakes, immersive war story.” (Starred review)

@kirkus_reviews: “An impeccably researched ‘you are there’ novel with a real-time approach, Jones’ entertaining fiction debut (following nonfiction books including Crusaders, 2019) moves episodically from encounter to life-threatening encounter . . . the book hums with black humor…” (Starred review)

