Dan Jones is coming to the USA for an exclusive speaking event in Salt Lake City, Utah! Presented by Author Fan Travel and Jordan Education Foundation, this event on May 16th 2024 will raise support for the Jordan School District in Utah. Teachers, history buffs, and fans are all welcome! You will have a chance to meet Dan Jones and listen to him speak while enjoying dinner. You will also receive a signed copy of “Powers and Thrones: A New History of the Middle Ages” by Dan Jones!

Utah Educators will receive recertification credit.  Others will be determined on an individual basis.

Register at www.AuthorFanTravel.com!

